import { Component } from "react";
import ReactTypingEffect from "react-typing-effect";
class Home extends Component {
  render() {
    return (
          <div className="Home-card">
            <div>
              <ReactTypingEffect text="WELCOME TO MY PERSONAL PROFILE.." speed={80} eraseDelay={200}></ReactTypingEffect>
            </div>
            <div>
              <p>about my personal profile..</p>
            </div>
            <button>Get Started</button>
          </div>
    );
  }
}
export default Home;
